export const signUps = (state={loggedIn: false, currentUser: {}}, action) => {
   switch(action.type) {
      case "SIGNUP_SUCCESS":
         return {
            ...state,
            loggedIn: action.payload.loggedIn,
            currentUser: action.payload.currentUser
         }
      default:
         return state
   }
}
